import React from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';
import "./index.css"


function ncard(val){
  console.log(val)
  return(
    <Cards
    snam = {val.sname}
    titl = {val.title}
  />
  );

}

ReactDOM.render(
  <>
    {Sdata.map(ncard)}
  </>,document.getElementById('root')

  );
